import React from 'react';
import '../../sass/Tela1/tela1.css'
import BMilitar from './BaixaMilitar';
import BPEFab from './BaixaPlacaExFab';

const Tela3 = () => {

    const [tela1, setTela1] = React.useState(false);
    const [tela2, setTela2] = React.useState(false);
    const [tela3, setTela3] = React.useState(false);
    const [tela4, setTela4] = React.useState(false);
    const [tela5, setTela5] = React.useState(false);

    const botaoOpt1 = () => {
        tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
    }
    const botaoOpt2 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
    }
    const botaoOpt3 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
    }
    const botaoOpt4 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        tela4 ? setTela4(tela4) : setTela4(!tela4);
        !tela5 ? setTela5(tela5) : setTela5(!tela5);
    }
    const botaoOpt5 = () => {
        !tela1 ? setTela1(tela1) : setTela1(!tela1);
        !tela2 ? setTela2(tela2) : setTela2(!tela2);
        !tela3 ? setTela3(tela3) : setTela3(!tela3);
        !tela4 ? setTela4(tela4) : setTela4(!tela4);
        tela5 ? setTela5(tela5) : setTela5(!tela5);
    }

    return (
        <>
            <div className='tela--inicial--tela1'>
                <p className='item' onClick={botaoOpt1} >Baixa de Placa de Experiência ou de Fabricante</p>
                <p className='item' onClick={botaoOpt2} >Baixa para Militarização</p>
                <p className='item' onClick={botaoOpt3} >Baixa para outra UF</p>
                <p className='item' onClick={botaoOpt4} >Baixa para outro Pais</p>
                <p className='item' onClick={botaoOpt5} >Baixa Simples de Veículo</p>
            </div>
            {!tela1 ? null : <BPEFab />}
            {!tela2 ? null : <BMilitar /> }
        </>
    )
}

export default Tela3
